/* Function  structure for function  `fGenerateSequence` */

/*!50003 DROP FUNCTION IF EXISTS `fGenerateSequence` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fGenerateSequence`(pTable
varchar(100), pOutletCode varchar(30)) RETURNS varchar(30) CHARSET utf8
    DETERMINISTIC
BEGIN
	Update sequence set LastNumber = LastNumber + 1 where `Table` = pTable and OutletCode = pOutletCode;
	
	Return (Select Concat(Prefix,LPAD(LastNumber,`Length`,'0')) as SequenceId
	from sequence where `Table` = pTable and OutletCode = pOutletCode);
    END */$$
DELIMITER ;

