DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fGetInventoryHeaderAmountFormat`(pHeaderId bigint(20)) RETURNS varchar(30) CHARSET latin1
BEGIN
	return (Select FORMAT(TotalAmount,2) FROM inventoryheader where HeaderId = pHeaderId);
    END */$$
DELIMITER ;

/* Function  structure for function  `fGetStockQtyOnHand` */

/*!50003 DROP FUNCTION IF EXISTS `fGetStockQtyOnHand` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fGetStockQtyOnHand`(pLocation bigint(20),pStockId bigint(20)) RETURNS decimal(10,2)
    NO SQL
    DETERMINISTIC
BEGIN
	DECLARE res DECIMAL(10,2);
	SET res=(SELECT COALESCE(SUM(`In`)-SUM(`Out`),0) AS `Qty on Hand` FROM inventorydetail WHERE `Status` = 'Active' AND StockId = pStockId AND LocationId = pLocation and Final = 'Y' GROUP BY StockId);
	RETURN res;
    END */$$
DELIMITER ;

