DELIMITER ;

/* Procedure structure for procedure `spFinalizeInventoryHeader` */

/*!50003 DROP PROCEDURE IF EXISTS  `spFinalizeInventoryHeader` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spFinalizeInventoryHeader`(pHeaderId bigint(20),
				       pUsername VARCHAR(30),
				       pHostname VARCHAR(15))
BEGIN
	update inventoryheader SET
	Final = 'Y',
	FinalDate = Now(),
	FinalizedBy = pUsername
	where
	HeaderId = pHeaderId;
	
	update inventorydetail set
	Final = 'Y'
	where
	HeaderId = pHeaderId;
	
	INSERT audittrail SET
	LogDescription = CONCAT(fWhosThisUser(pUsername),' finalizes an Inventory Header. HeaderId:',
	pHeaderId),
	Username = pUsername,
	`Date` = NOW(),
	Hostname = pHostname;
	
    END */$$
DELIMITER ;

