DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetCustomerTransactions`(pFromDate DATE,pToDate DATE,pCustomerId BIGINT(20))
BEGIN
	SELECT DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Type,id.DetailId AS Id,id.StockId AS `Stock Id`,id.StockDescription AS `Stock Description`,
	id.Unit,l.Description AS Location,id.IN AS `Qty-IN`,id.Balance,
	id.UnitPrice AS `Unit Price`,id.TotalPrice AS `Total Price`,id.Remarks
	FROM inventorydetail id
	LEFT JOIN location l
	ON id.LocationId = l.Id
	LEFT JOIN inventoryheader ih
	ON id.HeaderId = ih.HeaderId
	WHERE
	id.Status = 'Active' AND 
	ih.Status = 'Active' AND ih.Final = 'Y' AND ih.CustomerId = pCustomerId and
	DATE(ih.`Date`) >= DATE(pFromDate) AND DATE(ih.`Date`) <= DATE(pToDate);
    END */$$
