/* Procedure structure for procedure `spGetInventoryDetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetInventoryDetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetInventoryDetails`(pHeaderId BIGINT(20))
BEGIN
	SET @HeaderType  = (Select `Type` from inventoryheader where HeaderId = pHeaderId);
	
	if(@HeaderType = 'Stock Receiving') then
		SELECT id.DetailId AS Id,id.StockId AS `Stock Id`,id.StockDescription AS `Stock Description`,
		id.Unit,l.Description as Location,id.IN as `Qty-IN`,id.Balance,
		id.UnitPrice AS `Unit Price`,id.TotalPrice AS `Total Price`,id.Remarks
		FROM inventorydetail id
		left join location l
		on id.LocationId = l.Id
		WHERE
		id.`Status` = 'Active' AND id.HeaderId = pHeaderId;
	else
		IF(@HeaderType = 'Stock Withdrawal') THEN
			SELECT id.DetailId AS Id,id.StockId AS `Stock Id`,id.StockDescription AS `Stock Description`,
			id.Unit,l.Description AS Location,id.OUT AS `Qty-OUT`,id.Balance,
			id.UnitPrice AS `Unit Price`,id.TotalPrice AS `Total Price`,id.Remarks
			FROM inventorydetail id
			LEFT JOIN location l
			ON id.LocationId = l.Id
			WHERE
			id.`Status` = 'Active' AND id.HeaderId = pHeaderId;
		ELSE
			SELECT id.DetailId as Id,id.StockId as `Stock Id`,id.StockDescription as `Stock Description`,
			id.Unit,l.Description AS Location,id.IN AS `Qty-IN`,id.OUT AS `Qty-OUT`,id.Balance,
			id.UnitPrice AS `Unit Price`,id.TotalPrice AS `Total Price`,id.Remarks
			FROM inventorydetail id
			LEFT JOIN location l
			ON id.LocationId = l.Id
			WHERE
			id.`Status` = 'Active' AND id.HeaderId = pHeaderId;
		end if;
	end if;
    END */$$
DELIMITER ;

