/* Procedure structure for procedure `spGetInventoryHeaders` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetInventoryHeaders` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetInventoryHeaders`(pDisplayType VARCHAR(15),pPrimaryKey varchar(30),pSearchString VARCHAR(100),pType varchar(50))
BEGIN
	SET @SearchString  = CONCAT('%',pSearchString,'%');
	IF(pSearchString != '') THEN	
		if(pType = 'Stock Receiving') then
			SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Final,
			ih.Reference,s.Name AS `Supplier`,ih.TotalIn AS `Total Qty-IN`,
			ih.TotalAmount AS `Total Amount`,
			ih.Username AS `Received By`,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,
			ih.FinalizedBy AS `Finalized By`,ih.Remarks
			FROM inventoryheader ih
			LEFT JOIN supplier s
			ON ih.SupplierId = s.Id
			WHERE
			ih.`Status` = 'Active' and ih.Final= 'N' AND ih.Type = pType AND (ih.Reference LIKE @SearchString) ORDER BY ih.HeaderId DESC;
		else
			IF(pType = 'Stock Withdrawal') THEN
				SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Final,
				ih.Reference,c.Name AS `Customer`,ih.TotalOut AS `Total Qty-OUT`,
				ih.TotalAmount AS `Total Amount`,
				ih.Username AS `Released By`,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,
				ih.FinalizedBy AS `Finalized By`,ih.Remarks
				FROM inventoryheader ih
				LEFT JOIN customer c
				ON ih.CustomerId = c.Id
				WHERE
				ih.`Status` = 'Active' AND ih.Final= 'N' AND ih.Type = pType AND (ih.Reference LIKE @SearchString) ORDER BY ih.HeaderId DESC;
			else
				SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Type,ih.Final,
				ih.Reference,s.Name AS `Supplier`,c.Name AS `Customer`,ih.TotalIn AS `Total Qty-IN`,ih.TotalOUT AS `Total Qty-OUT`,
				ih.TotalAmount AS `Total Amount`,
				ih.Username AS `Adjusted By`,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,
				ih.FinalizedBy AS `Finalized By`,ih.Remarks
				FROM inventoryheader ih
				LEFT JOIN customer c
				ON ih.CustomerId = c.Id
				LEFT JOIN supplier s
				ON ih.SupplierId = s.Id
				WHERE
				ih.`Status` = 'Active' AND ih.Final= 'N' AND (ih.Type != 'Stock Receiving' and ih.Type != 'Stock Withdrawal') AND (ih.Reference LIKE @SearchString) ORDER BY ih.HeaderId DESC;
			END IF;
		end if;
	ELSE 
		IF(pDisplayType = 'ViewAll') THEN
			IF(pType = 'Stock Receiving') THEN
				SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Final,
				ih.Reference,s.Name AS `Supplier`,ih.TotalIn AS `Total Qty-IN`,
				ih.TotalAmount AS `Total Amount`,
				ih.Username AS `Received By`,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,
				ih.FinalizedBy AS `Finalized By`,ih.Remarks
				FROM inventoryheader ih
				LEFT JOIN supplier s
				ON ih.SupplierId = s.Id
				WHERE
				ih.`Status` = 'Active' AND ih.Final= 'N' AND ih.Type = pType ORDER BY ih.HeaderId DESC;
			else 
				if(pType = 'Stock Withdrawal') THEN
					SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Final,
					ih.Reference,c.Name AS `Customer`,ih.TotalOut AS `Total Qty-OUT`,
					ih.TotalAmount AS `Total Amount`,
					ih.Username AS `Released By`,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,
					ih.FinalizedBy AS `Finalized By`,ih.Remarks
					FROM inventoryheader ih
					LEFT JOIN customer c
					ON ih.CustomerId = c.Id
					WHERE
					ih.`Status` = 'Active' AND ih.Final= 'N' AND ih.Type = pType ORDER BY ih.HeaderId DESC;
				else
					SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Type,ih.Final,
					ih.Reference,s.Name AS `Supplier`,c.Name AS `Customer`,ih.TotalIn AS `Total Qty-IN`,ih.TotalOUT AS `Total Qty-OUT`,
					ih.TotalAmount AS `Total Amount`,
					ih.Username AS `Adjusted By`,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,
					ih.FinalizedBy AS `Finalized By`,ih.Remarks
					FROM inventoryheader ih
					LEFT JOIN customer c
					ON ih.CustomerId = c.Id
					LEFT JOIN supplier s
					ON ih.SupplierId = s.Id
					WHERE
					ih.`Status` = 'Active' AND ih.Final= 'N' and (ih.Type != 'Stock Receiving' and ih.Type != 'Stock Withdrawal') ORDER BY ih.HeaderId DESC;
				end if;
			end if;
		else 
			SELECT ih.HeaderId AS `Id`,DATE_FORMAT(ih.`Date`,'%m-%d-%Y') AS `Date`,ih.Type,ih.Final,
			ih.Reference,c.Name as `Customer`,s.Name as `Supplier`,ih.TotalIn as `Total Qty-IN`,ih.TotalOUT as `Total Qty-OUT`,
			ih.TotalAmount as `Total Amount`,
			ih.Username,DATE_FORMAT(ih.FinalDate,'%m-%d-%Y') AS `Final Date`,ih.FinalizedBy as `Finalized By`,
			ih.Remarks,ih.CustomerId,ih.SupplierId,s.Terms,s.Address as SupplierAddress,c.Address as `CustomerAddress`
			FROM inventoryheader ih
			LEFT JOIN customer c
			ON ih.CustomerId = c.Id
			left join supplier s
			on ih.SupplierId = s.Id
			WHERE
			ih.`Status` = 'Active' and ih.HeaderId = pPrimaryKey;
		END IF;
	END IF;	
    END */$$
DELIMITER ;

