/* Procedure structure for procedure `spGetStockCard` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetStockCard` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetStockCard`(pFromDate DATE,pToDate DATE,pStockId varchar(30))
BEGIN
	SELECT DATE_FORMAT(id.`Date`,'%m-%d-%Y') AS `Date`,id.Type,l.Description AS Location,id.`IN`,id.`OUT`,
	id.Balance,id.UnitPrice as `Unit Price`,id.TotalPrice as `Total Price`,CONCAT(id.Reference,' - ',COALESCE(c.Name,''),COALESCE(s.Name,'')) AS Reference,id.Remarks
	FROM inventorydetail id
	LEFT JOIN location l
	ON id.LocationId = l.Id
	LEFT JOIN customer c
	ON id.CustomerId = c.Id
	LEFT JOIN supplier s
	ON id.SupplierId = s.Id
	WHERE DATE(id.`Date`) >= DATE(pFromDate) AND DATE(id.`Date`) <= DATE(pToDate) AND id.StockId = pStockId and id.Final = 'Y' and id.Status = 'Active' ORDER BY id.FinalizedDate ASC;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spGetStockCardBegBal` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetStockCardBegBal` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetStockCardBegBal`(pFromDate DATE, pStockId BIGINT(20))
BEGIN
	SELECT COALESCE(SUM(`IN`),0) AS `IN`,COALESCE(SUM(`OUT`),0) AS `OUT`,COALESCE(SUM(`IN`)-SUM(`OUT`),0) AS Balance
	FROM inventorydetail
	WHERE DATE(`Date`) < DATE(pFromDate) AND StockId = pStockId and Final = 'Y' and `Status` = 'Active' ORDER BY `Date` ASC;
    END */$$
DELIMITER ;

