/* Procedure structure for procedure `spGetSuppliers` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetSuppliers` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetSuppliers`(pDisplayType VARCHAR(15), pSearchString VARCHAR(100))
BEGIN
	SET @SearchStrings  = CONCAT('%',pSearchString,'%');
	IF(pSearchString != '') THEN
		SELECT Id,`Name`,Address,ContactPerson AS `Contact Person`,ContactNo AS `Contact No.`,
		Terms,CreditLimit AS `Credit Limit`,Remarks
		FROM supplier
		WHERE `Status` = 'Active' AND `Name` LIKE @SearchStrings;
	ELSE 
		IF(pDisplayType = 'ViewAll') THEN
			SELECT Id,`Name`,Address,ContactPerson AS `Contact Person`,ContactNo AS `Contact No.`,
			Terms,CreditLimit AS `Credit Limit`,Remarks
			FROM supplier
			WHERE `Status` = 'Active';
		END IF;
	END IF;
    END */$$
DELIMITER ;

