/* Procedure structure for procedure `spGetTemplateNames` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetTemplateNames` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetTemplateNames`(pMenuName varchar(100),pUsername varchar(30))
BEGIN
	/*get public */
	Select TemplateName from searchdisplayfield
	where MenuName = pMenuName and `Status` = 'Active' and Private = 'N' Group by TemplateName Asc
	union
	SELECT TemplateName FROM searchfilters
	WHERE MenuName = pMenuName AND `Status` = 'Active' AND Private = 'N' GROUP BY TemplateName ASC
	UNION
	SELECT TemplateName FROM searchgrouping
	WHERE MenuName = pMenuName AND `Status` = 'Active' AND Private = 'N' GROUP BY TemplateName ASC
	/*get public */
	Union
	SELECT TemplateName FROM searchdisplayfield
	WHERE MenuName = pMenuName AND `Status` = 'Active' AND Private = 'Y' and CreatedBy = pUsername GROUP BY TemplateName ASC
	UNION
	SELECT TemplateName FROM searchfilters
	WHERE MenuName = pMenuName AND `Status` = 'Active' AND Private = 'Y' AND CreatedBy = pUsername GROUP BY TemplateName ASC
	UNION
	SELECT TemplateName FROM searchgrouping
	WHERE MenuName = pMenuName AND `Status` = 'Active' AND Private = 'Y' AND CreatedBy = pUsername GROUP BY TemplateName ASC;
    END */$$
DELIMITER ;

