	'; LocationId:',pLocationId,'; IN:',pIN,'; OUT:',pOUT,'; Balance:',pBalance,'; UnitPrice:',pUnitPrice,
	'; TotalPrice:',pTotalPrice,';Remarks:',pRemarks),
	Username = pUsername,
	`Date` = NOW(),
	Hostname = pHostname;
    END */$$
