						pUsername VARCHAR(30),
						pHostname VARCHAR(15))
BEGIN
	SET @counter = (SELECT COUNT(*) FROM usergroupmenuitems WHERE UserGroupId = pUserGroupId AND Menu = pMenu and Item = pItem);
