/* Procedure structure for procedure `spUpdateInventoryDetail` */

/*!50003 DROP PROCEDURE IF EXISTS  `spUpdateInventoryDetail` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateInventoryDetail`(pDetailId BIGINT(20),
				       pHeaderId BIGINT(20),
				       pStockId bigint(20),
				       pStockDescription varchar(200),
				       pUnit varchar(50),
				       pLocationId BIGINT(20),
				       pIN DECIMAL(10,2),
				       pOUT DECIMAL(10,2),
				       pBalance DECIMAL(10,2),
				       pUnitPrice DECIMAL(10,2),
				       pTotalPrice DECIMAL(10,2),
				       pRemarks VARCHAR(200),
				       pUsername VARCHAR(30),
				       pHostname VARCHAR(15))
BEGIN
	Update inventorydetail SET
	HeaderId = pHeaderId,
	StockId = pStockId,
	StockDescription = pStockDescription,
	Unit = pUnit,
	LocationId = pLocationId,
	`IN` = pIN,
	`OUT` = pOUT,
	Balance = pBalance,
	UnitPrice = pUnitPrice,
	TotalPrice = pTotalPrice,
	Remarks = pRemarks,
	`Date` = (SELECT `Date` FROM inventoryheader WHERE HeaderId = pHeaderId),
	`Type` = (SELECT `Type` FROM inventoryheader WHERE HeaderId = pHeaderId),
	Final = (SELECT Final FROM inventoryheader WHERE HeaderId = pHeaderId),
	Reference = (SELECT Reference FROM inventoryheader WHERE HeaderId = pHeaderId),
	CustomerId = (SELECT CustomerId FROM inventoryheader WHERE HeaderId = pHeaderId),
	SupplierId = (SELECT SupplierId FROM inventoryheader WHERE HeaderId = pHeaderId),
	Username = (SELECT Username FROM inventoryheader WHERE HeaderId = pHeaderId)
	where
	DetailId = pDetailId;
	
	INSERT audittrail SET
	LogDescription = CONCAT(fWhosThisUser(pUsername),' updates an Inventory Detail. DetailId:',
	pDetailId,'; HeaderId:',pHeaderId,'; StockId:',pStockId,'; StockDescription:',pStockDescription,'; Unit:',pUnit,'; LocationId:',pLocationId,
	'; IN:',pIN,'; OUT:',pOUT,'; Balance:',pBalance,'; UnitPrice:',pUnitPrice,'; TotalPrice:',pTotalPrice,';Remarks:',pRemarks),
	Username = pUsername,
	`Date` = NOW(),
	Hostname = pHostname;
    END */$$
DELIMITER ;

