/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateQtyOnHand`(pDetailId bigint(20))
BEGIN
	SET @StockId = (Select StockId from inventorydetail where DetailId = pDetailId);
	set @LocationId = (SELECT LocationId FROM inventorydetail WHERE DetailId = pDetailId);
	
	update inventorydetail set
	Balance = fGetStockQtyOnHand(@LocationId,@StockId),
	FinalizedDate = now()
	where
	DetailId = pDetailId;
	
    END */$$
DELIMITER ;

