/*Table structure for table `vstockreorderlevelvariance` */

DROP TABLE IF EXISTS `vstockreorderlevelvariance`;

/*!50001 DROP VIEW IF EXISTS `vstockreorderlevelvariance` */;
/*!50001 DROP TABLE IF EXISTS `vstockreorderlevelvariance` */;

/*!50001 CREATE TABLE  `vstockreorderlevelvariance`(
 `Stock Id` bigint(20) ,
 `Stock Description` varchar(200) ,
 `Inventory Group` varchar(200) ,
 `Category` varchar(200) ,
 `Unit` varchar(50) ,
 `Qty on Hand` decimal(33,2) ,
 `Reorder Level` decimal(10,2) ,
 `Variance` decimal(34,2) 
)*/;

/*View structure for view vstockreorderlevelvariance */

/*!50001 DROP TABLE IF EXISTS `vstockreorderlevelvariance` */;
/*!50001 DROP VIEW IF EXISTS `vstockreorderlevelvariance` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vstockreorderlevelvariance` AS (select `id`.`StockId` AS `Stock Id`,`id`.`StockDescription` AS `Stock Description`,`ig`.`Description` AS `Inventory Group`,`c`.`Description` AS `Category`,`id`.`Unit` AS `Unit`,coalesce((sum(`id`.`IN`) - sum(`id`.`OUT`)),0) AS `Qty on Hand`,`s`.`ReorderLevel` AS `Reorder Level`,(`s`.`ReorderLevel` - coalesce((sum(`id`.`IN`) - sum(`id`.`OUT`)),0)) AS `Variance` from (((`inventorydetail` `id` left join `stock` `s` on((`id`.`StockId` = `s`.`Id`))) left join `category` `c` on((`s`.`CategoryId` = `c`.`Id`))) left join `inventorygroup` `ig` on((`c`.`InventoryGroupId` = `ig`.`Id`))) where ((`id`.`Status` = 'Active') and (`id`.`Final` = 'Y')) group by `id`.`StockId`) */;

